import React from "react";
import ReactDOM from "react-dom";
//import image from "../public/asset/kobeBryant.jpg";

class Cell extends React.Component {

    constructor(props) {
        super(props);
    }


    componentDidMount() {
        const current = ReactDOM.findDOMNode(this);
        let button = current.querySelector(".upVote");
        let player = this.props.name;
        console.log(player);
        button.addEventListener("click", (e)=>{
            fetch("/nba/"+player, {
                method:"post",
                body:{
                    "name": player
                }
            });
        })
    }


    render() {
        return (
            <tr className="row">
                <th>{this.props.index}</th>
                <th>
                    <div className="image_border">
                        <img src={this.props.player.image} className="profile_pic" alt="" >
                        </img>
                        <div className="medal"></div>
                    </div></th>
                <th><div className="name">{this.props.player.name}</div></th>
                <th>
                    <a className="upVote">
                        <img src="/asset/vote_btn.svg"></img>
                    </a>
                </th>
                <th className="count">{this.props.player.count}</th>
            </tr>
        );
    }
}

export default Cell;
